import React from 'react';

function Education() {
    return ( 
        <div className='container'>
            <div className='row'>
                <div className='col-6'>
                    <img src='Media\Images\education.svg' />
                </div>
                <div className='col-6'>
                    <h2 className='mb-2'>Free and open market education</h2>
                    <p className='mb-1'>Varsity, the largest online stock market education book in the world covering everything from the basics to advance trading.</p>
                    <p className='mb-1'>Trading .</p>
                </div>
            </div>
        </div>
     );
}

export default Education;
